import React from 'react'
import Moment from 'moment'

class DateItem extends React.Component {

  render(){
    console.log(this.props.date.date);
    return(
      <div>
      <Moment format="DD/MM/YYYY">
               1976-04-19T12:59-0500
           </Moment>
      </div>
    )
  }
}

export default DateItem
